Consumes the `BinaryHeap` and returns the underlying vector
in arbitrary order.

# Examples

Basic usage:

```
use std::collections::BinaryHeap;
let heap = BinaryHeap::from([1, 2, 3, 4, 5, 6, 7]);
let vec = heap.into_vec();

// Will print in some order
for x in vec {
    println!("{x}");
}
```
